const rambo = `data:image/jpeg;base64,`;

const image = document.createElement("img");

let completed = false;

const styleShow = `position: fixed;
left: 50%;
top: 50%;
transform: translate(-50%,-50%);
`;
const styleHide = "display: none";

image.src = rambo;
image.id = "rambo";
image.setAttribute("style", styleHide);
document.body.append(image);

const successString = "!  .";
setInterval(() => {
  const hasText = window.document.body.innerText.includes(successString);
  if (completed && !hasText) {
    completed = false;
    image.setAttribute("style", styleHide);
  }

  if (!completed && hasText) {
    completed = true;
    chrome.runtime.sendMessage("success");
    image.setAttribute("style", styleShow);
  }
}, 200);
